script: |
  super -f text -I q3904.spq | sort > q3904.out

inputs:
  - name: q3904.spq
    data: |
      SELECT DISTINCT + col1 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( 55 * 27 * + ( + col0 ) + - col1 BETWEEN - col2 + + + col2 / - col2 * - - col2 AND NULL );
  - name: tab2

outputs:
  - name: q3904.out
    data: |
